export default class Tag {
    id: string;

    constructor(obj: any) {
      this.id = obj.id
    }
}

export class Tags {
    ids: Array<Tag>;

    constructor(ids: Array<Tag>) {
      this.ids = ids;
    }

    get values(): string {
      return this.ids.map(x => x.id).join(' ')
    }
}
